import "./project.css";

const Project = ({ img, link,desc,title }) => {
  return (
    <div className="p-container">
      <div className="p">
        <div className="p-browser">
          <div className="p-circle"></div>
          <div className="p-circle"></div>
          <div className="p-circle"></div>
        </div>
        <div className="p-img">
          <img src={img} alt="" />
        </div>
      </div>
      <div className="p-img-title">
          <h6 src={title}/>
      </div> 
      <div className="p-desc">
          <p src={desc}/>
      </div>
    </div>
  );
};

export default Project;
